  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Flint Hills NWR
  outlines Refuge accomplishments during the 1985 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions. The
  administration section discusses personnel, youth programs, funding, safety, and
  technical assistance. Habitat management is covered; croplands, grasslands, wetlands,
  forests, fire management, pest control, water rights, and wilderness and special
  areas are discussed. The wildlife section of the report discusses endangered and
  threatened species, migratory birds, game mammals, fisheries resources, and marking
  and banding. Interpretation and recreation activities are outlined; topics include
  information and interpretation, recreational uses, and law enforcement. The equipment
  and facilities section discusses rehabilitation, equipment utilization and replacement,
  and energy conservation. Cooperative programs and items of interest, photographs,
  and brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
